import React from 'react'
import './Navigation.css'
import { NavLink, Outlet, useNavigate } from 'react-router-dom'

export default function Navigation() {

    const navigate = useNavigate()

    const onClick = (e) => {
        e.preventDefault()
        navigate('/weather-forecast/8days')
    }

    return (
        <>
            <nav>
                <ul className='navigation'>
                    <li><NavLink className='now-navigation' to="/">Weather Now</NavLink></li>
                    <li><NavLink className='forecast-navigation' onClick={onClick} to="/weather-forecast">Weather Forecast</NavLink></li>
                </ul>
            </nav>
            <Outlet />
        </>
    )
}
